import React, { useState, useEffect } from "react";
import End from "./End";
import axios from "axios";

export default function User(props) {
  const [data, setData] = useState([{}]);
  const [test, setTest] = useState("");

  const checkName = () => {
    // props.history.push("/example");
    alert("다음문항으로 이동");
  };

  function fetchData() {
    axios
      .get(
        "http://www.career.go.kr/inspct/openapi/test/questions?apikey=5894ecf675f64f28cd358b417ed6ad1b&q=6"
      )
      .then((response) => {
        const data = response.data.RESULT;
        // console.log(data[0].question); // 자바스크립트로 요소 1개 alert 띄워보기
        // console.log(JSON.stringify(data)); // 자바스크립트로 요소 전체 alert 띄워보기
        setData(data);
      })
      .catch((Error) => {
        console.log(Error);
      });
  }
  //html 코드가 return 된 이후에 한번만 GetOpenAPI() 함수를 호출
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      <div className="body-container">
        문항
        {data.map((jsondata, idx) => {
          // 이런식으로 map함수를 사용해 html코드 안에서 반복문을 돌릴 수 있습니다.
          return (
            <>
              <div>
                <label>
                  <input
                    type="radio"
                    name="test"
                    value="1"
                    // onChange={onChangeTest}
                  />
                  {jsondata.answer01}
                </label>
                <label>
                  <input
                    type="radio"
                    name="test"
                    value="2"
                    // onChange={onChangeTest}
                  />
                  {jsondata.answer02}
                </label>
              </div>
              <br></br>
              <br />

              <button disabled={test == "" ? true : false} onClick={checkName}>
                검사시작
              </button>
            </>
          );
        })}
      </div>
    </>
  );
}
